@JeromeFahrer Denominator is the same everywhere within a factor of ~2 (roughly 50% of pop). 
I think there's a very good chance they'll win on the numerator side. They were able to boost a good fraction of the population before covid got in. 
https://t.co/vscL0v1x7I

@MichaelSFuhrer That'll shift back a bit of course as they get into the tail end of the wave.

But with their high booster rate they may just hold on to win.

Australia may still win the excess death game though.
